import React from 'react'
import Item from './Item'

export const Items = (props) => {
    return (
        <main>
            {props.items?.map(el => (
                <Item key={el.id} item={el} onAdd={props.onAdd} /> 
            ))}
        </main>
    )
}

export default Items
